import "./App.css";

function App() {
  return (
    <div className="App">
      <header>
        <nav className="navbar">
          <div className="navbar-container">
            <Link to="/"></Link>
          </div>
        </nav>
        <h1> where's your next climb?</h1>
        <h3>find your next adventure by scrolling the list</h3>
      </header>
      <content>
        <div className="type-of-climb">hard</div>
        <div className="areas">wet</div>
      </content>
      <button>let's go!</button>
      <result></result>
    </div>
  );
}

export default App;
